import{_ as o}from"./_plugin-vue_export-helper.cdc0426e.js";import{o as p,c as t,f as e}from"./app.426af7b5.js";const c={},r=e('<h1 id="\u664B\u7EAA\u516B" tabindex="-1"><a class="header-anchor" href="#\u664B\u7EAA\u516B" aria-hidden="true">#</a> \u664B\u7EAA\u516B</h1><blockquote><p>\uFF08\u6C38\u5609\u4E8C\u5E74\uFF09\u51AC\uFF0C\u5341\u6708\uFF0C\u7532\u620C\uFF0C\u6C49\u738B\u6E0A\u5373\u7687\u5E1D\u4F4D\uFF0C\u5927\u8D66\uFF0C\u6539\u5143\u6C38\u51E4\u3002</p></blockquote><p><strong>\u300A\u8D44\u6CBB\u901A\u9274\u2022\u5377\u516B\u5341\u516D\u2022\u664B\u7EAA\u516B\u300B</strong></p><p>\u5728\u5927\u6C49\u738B\u671D\u706D\u4EA184\u5E74\uFF0C\u8700\u6C49\u706D\u4EA141\u5E74\u540E\uFF0C\u53C8\u6709\u4EBA\u625B\u8D77\u4E86\u201C\u6C49\u201D\u738B\u671D\u7684\u5927\u65D7\uFF0C\u8FF0\u7956\u7ECD\u7EDF\uFF0C<strong>\u8FFD\u7940\u6C49\u4EE3\u7684\u4E09\u7956\u4E94\u5B97</strong>\u3002</p><p>\u6240\u8C13\u4E09\u7956\u4E94\u5B97\uFF0C\u6307\u7684\u662F<code>\u6C49\u9AD8\u7956\u5218\u90A6</code>\u3001<code>\u4E16\u7956\u5149\u6B66\u5E1D\u5218\u79C0</code>\u3001<code>\u592A\u5B97\u6C49\u6587\u5E1D\u5218\u6052</code>\u3001<code>\u4E16\u5B97\u6C49\u6B66\u5E1D\u5218\u5F7B</code>\uFF0C<code>\u4E2D\u5B97\u6C49\u5BA3\u5E1D\u5218\u8BE2</code>\u3001<code>\u663E\u5B97\u6C49\u660E\u5E1D\u5218\u5E84</code>\u3001<code>\u8083\u5B97\u6C49\u7AE0\u5E1D\u5218\u709F</code>\uFF0C\u4EE5\u53CA<code>\u70C8\u7956\u662D\u70C8\u7687\u5E1D\u5218\u5907</code>\u3002</p><p>\u9664\u4E86\u8FD9\u4E9B\u4EBA\u4EE5\u5916\uFF0C\u5C31\u8FDE\u5728\u5F53\u65F6\u4EE5\u53CA\u540E\u4E16\u540D\u58F0\u4E0D\u4F73\u7684\u8700\u540E\u4E3B\u5218\u7985\u90FD\u88AB\u7FFB\u4E86\u51FA\u6765\u3002\u672C\u6765\u4F5C\u4E3A\u4EA1\u56FD\u4E4B\u541B\uFF0C\u5218\u7985\u662F\u6CA1\u6709\u4EBA\u7ED9\u4ED6\u4E0A\u8C25\u53F7\u7684\uFF0C\u4F46\u8FD9\u4E00\u6B21\uFF0C\u4ED6\u4E5F\u5F97\u5230\u4E86\u201C\u6000\u201D\u7684\u8C25\u53F7\uFF0C\u53D8\u6210\u5B5D\u6000\u7687\u5E1D\u3002</p><p>\u8FD9\u4E2A\u52A8\u4F5C\uFF0C\u50CF\u6781\u4E86\u5218\u5907\u5F53\u5E74\u79F0\u5E1D\u65F6\u7684\u60C5\u5F62\u3002\u5F53\u65F6\uFF0C\u5218\u5907\u5728\u6210\u90FD\u8BBE\u6C49\u671D\u5386\u4EE3\u7687\u5E1D\u7684\u795E\u4E3B\u796D\u7940\uFF0C\u4EE5\u793A\u81EA\u5DF1\u7EE7\u627F\u7684\u662F\u6C49\u5BA4\u4E4B\u6B63\u7EDF\u3002</p><p>\u5982\u4ECA\u65F6\u9694\u8FD1\u767E\u5E74\uFF0C\u53C8\u6709\u4EBA\u7AD9\u51FA\u6765\u505A\u540C\u6837\u7684\u4E8B\u3002\u4F46\u7A0D\u6709\u4E0D\u540C\u7684\u662F\uFF0C<strong>\u8FD9\u6B21\u5BA3\u79F0\u81EA\u5DF1\u662F\u6C49\u5BA4\u540E\u88D4\u7684\u4EBA\uFF0C\u5374\u662F\u4E00\u4E2A\u5308\u5974\u4EBA</strong>\u3002</p><p>\u4ED6\u53EB<code>\u5218\u6E0A</code>\u3002</p><p>\u5218\u6E0A\u7684\u767B\u573A\uFF0C\u610F\u5473\u6211\u4EEC\u7684\u53D9\u4E8B\u5C06\u6B63\u5F0F\u8FDB\u5165\u201C\u4E94\u80E1\u4E71\u534E\u201D\u90E8\u5206\u3002\u8FD9\u662F\u4E00\u4E2A\u829C\u6742\u7834\u788E\u7684\u65F6\u4EE3\uFF0C<strong>\u4F46\u8FD9\u91CE\u9A6C\u5636\u9E23\u7684\u4E09\u4E2A\u4E16\u7EAA\uFF0C\u5374\u53C8\u662F\u6211\u4EEC\u8FD9\u7247\u82CD\u539A\u6D51\u6734\u7684\u5927\u5730\u4E0A\u4E0D\u53EF\u8D8A\u8FC7\u7684\u65F6\u5149</strong>\u3002\u5728\u6F2B\u957F\u7684\u65F6\u95F4\u957F\u6CB3\u4E2D\uFF0C\u6709\u4E00\u80A1\u529B\u91CF\u6B63\u5728\u6DF7\u4E71\u4E2D\u6162\u6162\u805A\u5408\uFF0C\u4E0D\u65AD\u5B55\u80B2\uFF0C\u7B49\u5F85\u6700\u7EC8\u91CD\u751F\u7206\u53D1\u7684\u90A3\u4E00\u523B\u3002</p><p>\u4ECA\u5929\uFF0C\u5C31\u8BA9\u6211\u4EEC\u4ECE\u8FD9\u7B2C\u4E00\u4F4D\u767B\u573A\u7684\u4EBA\u7269\u8BB2\u8D77\u3002</p><p>\u5218\u6E0A\u5E76\u4E0D\u662F\u6C49\u5BA4\u5B97\u4EB2\uFF0C\u800C\u662F\u5308\u5974\u4EBA\u3002\u4ED6\u4E4B\u6240\u4EE5\u59D3\u5218\uFF0C\u8DDF\u4ED6\u7684\u8840\u7EDF\u6709\u5173\uFF1A<strong>\u4ED6\u662F\u5308\u5974\u738B\u5BA4\u7684\u540E\u4EE3</strong>\u3002</p><blockquote><p>\u5308\u5974\u81EA\u897F\u6C49\u5357\u5317\u5206\u88C2\u540E\uFF0C\u5357\u5308\u5974\u9010\u6E10\u5357\u8FC1\uFF0C\u6700\u540E\u8FDB\u5165\u957F\u57CE\u4EE5\u5185\u5B9A\u5C45\u3002\u56E0\u4E3A<strong>\u7956\u4E0A\u548C\u4EB2</strong>\u7684\u5173\u7CFB\uFF0C<strong>\u8FD9\u652F\u5308\u5974\u7684\u738B\u5BA4\u81EA\u79F0\u4E3A\u5218\u6C0F\u4E4B\u7525</strong>\uFF0C\u4ECE\u6B64\u5192\u59D3\u5218\u6C0F\u3002</p></blockquote><p>\u5230\u5218\u6E0A\u7684\u65F6\u4EE3\uFF0C\u5308\u5974\u5386\u53F2\u4E0A\u7684\u8F89\u714C\u5DF2\u7ECF\u662F\u6628\u65E5\u9EC4\u82B1\u3002\u5192\u987F\u5355\u4E8E\u56F4\u6C49\u9AD8\u7956\u4E8E\u767D\u767B\u5C71\uFF0C\u5DF2\u7ECF\u662F\u4E94\u767E\u5E74\u524D\u7684\u4E8B\uFF1B\u547C\u97E9\u90AA\u5355\u4E8E\u671D\u8BF7\u4E8E\u6C49\uFF0C\u8FCE\u5A36\u738B\u662D\u541B\uFF0C\u5DF2\u7ECF\u8FC7\u53BB\u4E86\u4E09\u767E\u4E94\u5341\u591A\u5E74\uFF1B\u81F3\u4E8E\u7AA6\u5BAA\u8FDC\u5F81\uFF0C\u52D2\u529F\u71D5\u7136\uFF0C\u4E5F\u5DF2\u7ECF\u662F\u4E09\u767E\u5E74\u524D\u7684\u4E8B\u4E86\u3002</p><p>\u5EFA\u5B8921\u5E74\uFF08\u516C\u5143216\u5E74\uFF09\uFF0C\u5308\u5974\u5355\u4E8E\u547C\u53A8\u6CC9\u5165\u90BA\u57CE\u89D0\u89C1\u66F9\u64CD\uFF0C\u66F9\u64CD\u7559\u4E4B\u4E8E\u90BA\u57CE\uFF0C<strong>\u5E76\u968F\u540E\u5C06\u5308\u5974\u5206\u4E3A\u4E94\u90E8\uFF0C\u201C\u4F7F\u4F7F\u8005\u76D1\u5176\u56FD\u201D\uFF0C\u5C45\u4E8E\u5E76\u5DDE</strong>\u3002\u81EA\u6B64\u4EE5\u540E\uFF0C\u5308\u5974\u4EBA\u5728\u5E76\u5DDE\u5B89\u5206\u5B88\u5DF1\u5730\u5F85\u4E86\u8FD1\u516B\u5341\u5E74\u3002</p><p><strong>\u76F4\u5230\u516B\u738B\u4E4B\u4E71\u7206\u53D1\uFF0C\u5218\u6E0A\u51FA\u73B0</strong>\u3002</p><p>\u5218\u6E0A\u51FA\u573A\u7684\u5E74\u4EE3\u5F88\u65E9\uFF0C\u8FD8\u5728\u4E09\u56FD\u672B\u5E74\u65F6\uFF0C\u5218\u6E0A\u5728\u6D1B\u9633\u505A\u4EBA\u8D28\uFF0C\u5C31\u5F88\u53D7\u53F8\u9A6C\u662D\u770B\u91CD\u3002\u5230\u4E86\u664B\u671D\uFF0C\u664B\u6B66\u5E1D\u53F8\u9A6C\u708E\u5BF9\u5218\u6E0A\u4E5F\u9752\u7750\u6709\u52A0\uFF0C\u4E00\u5EA6\u60F3\u8981\u91CD\u7528\u4ED6\u2014\u2014\u5F53\u65F6\u5173\u4E2D<code>\u9C9C\u5351</code>\u6811\u673A\u80FD\u53DB\u4E71\uFF0C\u6709\u4EBA\u5EFA\u8BAE\u547D\u5218\u6E0A\u5E26\u9886\u5308\u5974\u4E94\u90E8\u51FA\u5175\u3002</p><p>\u4F46\u8FD9\u906D\u5230\u4E86\u53CD\u5BF9\uFF1A<strong>\u5982\u679C\u5218\u6E0A\u80FD\u527F\u706D\u6811\u673A\u80FD\uFF0C\u90A3\u5230\u65F6\u5019\u8C01\u6765\u527F\u706D\u5218\u6E0A\u5462</strong>\uFF1F\u5218\u6E0A\u7684\u80FD\u529B\u4F17\u6240\u5468\u77E5\uFF0C\u53EF\u4ED6\u504F\u504F\u662F\u4E2A<code>\u5308\u5974</code>\u4EBA\uFF01</p><p>\u8FD9\u756A\u8BDD\u6DF1\u6DF1\u7684\u6253\u52A8\u4E86\u664B\u6B66\u5E1D\uFF0C\u5C31\u56E0\u4E3A\u8FD9\u4E2A\u539F\u56E0\uFF0C\u5218\u6E0A\u6B64\u540E\u4E00\u76F4\u6CA1\u6709\u51FA\u5934\u4E4B\u65E5\uFF0C\u8E49\u8DCE\u4E86\u8FD1\u4E09\u5341\u5E74\u4EBA\u751F\u3002</p><p>\u53F8\u9A6C\u708E\u6B7B\u540E\uFF0C\u6768\u9A8F\u8F85\u653F\uFF0C<strong>\u5218\u6E0A\u83B7\u5F97\u201C\u4E94\u90E8\u5927\u90FD\u7763\u201D\u7684\u4EFB\u547D\uFF0C\u4ECE\u6B64\u7B97\u662F\u6240\u6709\u5308\u5974\u4EBA\u7684\u5934\u9886</strong>\u3002</p><p>\u53C8\u8FC7\u4E86\u5927\u7EA6\u5341\u5E74\u65F6\u95F4\uFF0C\u65F6\u503C\u8BF8\u738B\u5927\u4E71\u6597\uFF0C\u6D88\u8017\u8D8A\u6765\u8D8A\u5927\u3002<code>\u6210\u90FD\u738B\u9896</code>\u4E00\u770B\uFF1A\u5308\u5974\u4EBA\u8FD8\u662F\u4E00\u652F\u53EF\u4EE5\u4F9D\u8D56\u7684\u5BF9\u8C61\u561B\uFF01\u5218\u6E0A\u4E8E\u662F\u6210\u4E3A\u6210\u90FD\u738B\u9896\u9EBE\u4E0B\u7684\u4E00\u5458\u3002</p><p>\u4F46\u6210\u90FD\u738B\u9896\u53EA\u662F\u60F3\u501F\u52A9\u5308\u5974\u4EBA\u7684\u529B\u91CF\uFF0C\u5BF9\u4E8E\u5218\u6E0A\u7684\u8BDD\uFF0C\u4ED6\u5E76\u4E0D\u5927\u653E\u5728\u5FC3\u4E0A\u3002\u6CA1\u591A\u4E45\uFF0C\u6210\u90FD\u738B\u9896\u5C31\u56E0\u4E3A\u548C\u5E7D\u5DDE\u523A\u53F2\u738B\u6D5A\u7684\u6597\u4E89\u5931\u8D25\uFF0C\u5E26\u7740\u664B\u60E0\u5E1D\u4ECE\u90BA\u57CE\u9003\u5411\u6D1B\u9633\uFF0C\u6CB3\u5317\u4E00\u5E26\u51FA\u73B0\u4E86\u77ED\u6682\u7684\u6743\u529B\u771F\u7A7A\u3002</p><p>\u5728\u9003\u79BB\u4E4B\u524D\uFF0C\u5218\u6E0A\u66FE\u529B\u529D\u6210\u90FD\u738B\u9896\u4E0D\u53EF\u51FA\u6B64\u4E0B\u7B56\uFF0C\u5B64\u8EAB\u8FDB\u6D1B\u9633\u662F\u4E0B\u4E0B\u4E4B\u9009\uFF0C\u4F46\u6210\u90FD\u738B\u9896\u4E00\u5982\u65E2\u5F80\u5730\u4E0D\u542C\u529D\u3002\u679C\u4E0D\u5176\u7136\uFF0C\u6210\u90FD\u738B\u9896\u53BB\u4E86\u6D1B\u9633\u540E\u4E00\u5982\u5218\u6E0A\u6240\u6599\uFF0C\u5F88\u5FEB\u5931\u53BB\u6743\u529B\u3002</p><p><strong>\u5218\u6E0A\u5728\u53F9\u606F\u4E4B\u4F59\u5E76\u4E0D\u9057\u61BE\uFF0C\u4ED6\u5F00\u59CB\u8003\u8651\u81EA\u5DF1\u7684\u4E8B</strong>\uFF1A\u8FD9\u51E0\u5341\u5E74\u6765\uFF0C\u4ED6\u5728\u664B\u671D\u5B98\u573A\u867D\u7136\u90C1\u90C1\u4E0D\u5F97\u5FD7\uFF0C\u4F46\u5728\u5308\u5974\u4EBA\u5185\u90E8\uFF0C\u5374\u5DF2\u7ECF\u662F\u65E0\u53EF\u4E89\u8BAE\u7684\u5171\u4E3B\u3002</p><p>\u5982\u4ECA\u897F\u664B\u6218\u4E71\uFF0C\u800C\u4ED6\u624B\u4E2D\u5DF2\u7ECF\u6709\u51E0\u4E07\u4EBA\u7684\u5175\u529B\u3002\u5218\u6E0A\u81EA\u89C9\u5EFA\u529F\u7ACB\u4E1A\u7684\u597D\u65F6\u673A\u5DF2\u7ECF\u5230\u6765\uFF0C\u9042\u81EA\u79F0\u6C49\u738B\u3002</p><p><strong>\u51E0\u5E74\u540E\uFF0C\u5218\u6E0A\u5373\u7687\u5E1D\u4F4D\uFF0C\u7ACB\u56FD\u53F7\u4E3A<code>\u6C49</code></strong>\u3002</p><p>\u4E00\u4E2A\u5308\u5974\u4EBA\uFF0C\u4EE5\u6C49\u4E3A\u56FD\u53F7\uFF0C\u8FD9\u770B\u4E0A\u53BB\u662F\u4E00\u4E2A\u5F88\u5947\u602A\u7684\u4E8B\u60C5\u3002</p><p>\u5BF9\u6B64\uFF0C\u5218\u6E0A\u6709\u81EA\u5DF1\u7684\u89E3\u91CA\uFF1A\u201C<strong>\u543E\u53C8\u6C49\u6C0F\u4E4B\u7525\uFF0C\u7EA6\u4E3A\u5144\u5F1F\uFF0C\u5144\u4EA1\u5F1F\u7ECD\uFF0C\u4E0D\u4EA6\u53EF\u4E4E\uFF1F</strong>\u201D\u6211\u662F\u6C49\u671D\u7687\u5E1D\u7684\u5916\u7525\uFF0C\u800C\u4E14\u7956\u4E0A\u66FE\u7ECF\u4E0E\u6C49\u5E1D\u7EA6\u4E3A\u5144\u5F1F\u3002\u5982\u4ECA\u5144\u957F\u53BB\u4E16\uFF0C\u5F1F\u5F1F\u7EE7\u627F\uFF0C\u8FD9\u96BE\u5230\u4E0D\u662F\u5F88\u6B63\u5E38\u7684\u4E8B\u5417\uFF1F</p><p>\u4F46\u8FD9\u756A\u903B\u8F91\u542C\u8D77\u6765\u4F9D\u7136\u5341\u5206\u7275\u5F3A\u3002</p><p>\u56E0\u6B64\uFF0C\u672C\u7BC7\u6211\u4EEC\u4E0D\u59A8\u6765\u5206\u6790\u4E00\u4E0B\uFF1A</p><p><strong>\u5218\u6E0A\u6B64\u4E3E\u7684<code>\u771F\u6B63\u76EE\u7684</code>\u7A76\u7ADF\u4F55\u5728\uFF0C\u4EE5\u53CA\u8FD9\u4E00\u4E3E\u52A8\u80CC\u540E\u7684\u590D\u6742\u601D\u8003</strong>\u3002</p><p>\u5355\u72EC\u770B\u5218\u6E0A\u4EE5\u53CA\u4ED6\u6240\u521B\u7ACB\u7684\u738B\u671D\uFF0C\u5F88\u5BB9\u6613\u4F1A\u8BA9\u4EBA\u4EE5\u4E3A\u8FD9\u5C31\u662F\u4E00\u4E2A\u666E\u901A\u7684\u5272\u636E\u653F\u6743\u7684\u8BDE\u751F\uFF0C\u5728\u4E2D\u56FD\u7684\u5386\u53F2\u4E0A\uFF0C\u8FD9\u6837\u7684\u4F8B\u5B50\u591A\u5230\u4E0D\u53EF\u80DC\u6570\u3002</p><p>\u4F46\u5176\u5B9E\u5E76\u4E0D\u5982\u6B64\u3002</p><p>\u5927\u90E8\u5206\u4EBA\u770B\u5F85\u8FD9\u6BB5\u5386\u53F2\u65F6\uFF0C\u90FD\u662F\u4EE5\u540E\u4E16\u4EBA\u7684\u773C\u5149\u6765\u770B\uFF0C\u56E0\u6B64\u5F88\u5BB9\u6613\u5F97\u51FA\u201C\u8FD9\u662F\u4E00\u4E2A\u666E\u901A\u7684\u5272\u636E\u653F\u6743\u201D\u7684\u7ED3\u8BBA\u3002\u4F46\u4E8B\u5B9E\u662F\uFF0C\u5982\u679C\u4F60\u7AD9\u5230\u5F53\u65F6\u7684\u89D2\u5EA6\uFF0C\u5C31\u4F1A\u53D1\u73B0\u5218\u6E0A\u6240\u9762\u4E34\u7684\u95EE\u9898\u4E00\u70B9\u90FD\u4E0D\u666E\u901A\uFF0C<strong>\u800C\u662F\u4E00\u4E2A\u524D\u65E0\u53E4\u4EBA\u3001\u6CA1\u6709\u4EFB\u4F55\u5148\u4F8B\u53EF\u5FAA\u7684\u5927\u96BE\u9898</strong>\uFF1A</p><p><strong>\u4E00\u4E2A<code>\u5F02\u65CF\u4EBA</code>\uFF0C\u8981\u5982\u4F55\u624D\u80FD\u5728<code>\u6C49\u65CF</code>\u4E16\u4EE3\u805A\u5C45\u7684\u4E2D\u539F\u5927\u5730\u4E0A\u83B7\u5F97\u7EDF\u6CBB\u5730\u4F4D\uFF1F</strong></p><p>\u6C49\u5308\u6218\u4E89\u80FD\u4E0A\u6EAF\u5230\u4E94\u767E\u5E74\u524D\u3002\u8FD9\u4E94\u767E\u5E74\u6765\uFF0C\u5308\u5974\u867D\u7136\u9010\u6E10\u5F0F\u5FAE\uFF0C\u4F46\u6C49\u4EBA\u5BF9\u4E8E\u5308\u5974\u7684\u9632\u5907\u5374\uFF0C\u5DF2\u7ECF\u6210\u4E3A\u4E00\u79CD\u523B\u5165\u9AA8\u5B50\u91CC\u7684\u672C\u80FD\u3002\u6B63\u662F\u56E0\u4E3A\u5982\u6B64\uFF0C\u66F9\u64CD\u624D\u4F1A\u628A\u5308\u5974\u4EBA\u5206\u4E3A\u4E94\u90E8\uFF0C\u5E76\u6D3E\u5175\u76D1\u89C6\uFF1B\u5218\u6E0A\u4E5F\u662F\u56E0\u4E3A\u8FD9\u4E2A\u539F\u56E0\uFF0C\u624D\u7A7A\u6709\u4E00\u8EAB\u672C\u4E8B\u4E0D\u88AB\u53F8\u9A6C\u708E\u91CD\u7528\u3002</p><p><strong>\u6015\u7684\uFF0C\u5C31\u662F\u5308\u5974\u5750\u5927\u96BE\u5236</strong>\u3002</p><p>\u800C\u4ECE\u6587\u5316\u7684\u89D2\u5EA6\u6765\u770B\uFF0C\u6C49\u4EBA\u5BF9\u5308\u5974\u7684\u6001\u5EA6\u5219\u662F<code>\u8F7B\u8511</code>\u3002\u8FD9\u662F\u4E00\u79CD\u6587\u660E\u4EBA\u5BF9\u5F85\u86EE\u65CF\u4EBA\u7684\u5FC3\u6001\uFF0C<strong>\u76F8\u8F83\u4E8E\u9632\u5907\u4E4B\u60C5\uFF0C\u8FD9\u79CD\u6B67\u89C6\u53EF\u80FD\u66F4\u96BE\u6D88\u89E3</strong>\u3002</p><p>\u8FD9\u4E9B\u90FD\u662F\u5218\u6E0A\u8981\u9762\u5BF9\u7684\u6311\u6218\u3002\u5728\u8FD9\u4E48\u4E00\u79CD\u73AF\u5883\u4E0B\uFF0C\u60F3\u8981\u5EFA\u7ACB\u8D77\u7EDF\u6CBB\uFF0C\u96BE\u5EA6\u53EF\u60F3\u800C\u77E5\u3002</p><blockquote><p>\u5982\u679C\u8FD9\u4E48\u8BF4\u8FD8\u6BD4\u8F83\u62BD\u8C61\u7684\u8BDD\uFF0C\u90A3\u4E48\u6211\u4EEC\u53EF\u4EE5\u4E3E\u4E00\u4E2A\u73B0\u5B9E\u4E00\u70B9\u7684\u4F8B\u5B50\uFF1A</p><p><strong>\u72B9\u592A\u4EBA\u8981\u5982\u4F55\u5728\u5DF4\u52D2\u65AF\u5766\u5730\u533A\u5EFA\u7ACB\u4E00\u4E2A\u7EDF\u6CBB\u963F\u62C9\u4F2F\u4EBA\u7684\u653F\u6743</strong>\uFF1F</p></blockquote><p>\u73B0\u5B9E\u6240\u89C1\uFF0C\u8FD9\u51E0\u4E4E\u662F\u4E0D\u53EF\u80FD\u7684\u3002\u5373\u4FBF\u4E24\u5343\u5E74\u4EE5\u6765\uFF0C\u653F\u6CBB\u5B66\u7684\u53D1\u5C55\u5DF2\u7ECF\u76F8\u5F53\u6210\u719F\uFF0C\u4F46\u8FD9\u4F9D\u7136\u662F\u4E00\u4E2A\u65E0\u6CD5\u89E3\u51B3\u7684\u96BE\u9898\u3002</p><p>\u5218\u6E0A\u9762\u4E34\u7684\uFF0C\u5C31\u662F\u7C7B\u4F3C\u7684\u95EE\u9898\u3002</p>',42),n=[r];function s(d,g){return p(),t("div",null,n)}const l=o(c,[["render",s],["__file","jinji8.html.vue"]]);export{l as default};
